measurements.description:
Seventy-two scented, well- spaced flowers and three buds on six inflorescences; sepals pale yellow, overlaid and striped mahogany,
	margins remain pale yellow; 
	petals pale yellow, overlaid and striped mahogany, speckles coalesce into stripes superiorly, margins remain pale yellow;
	lip light cream heavily spotted dark mahogany, margins solid dark mahogany; column striped and spotted dark mahogany;
    substance firm; texture matte.
